import "bootstrap/dist/css/bootstrap.min.css";
import {useNavigate } from 'react-router-dom';
import { Button} from "react-bootstrap";
import Card from 'react-bootstrap/Card';
import { donatorslip } from "../../service/service";
import {useEffect, useState} from 'react';


function Success() {
  const navigate = useNavigate();


const[users, setUsers]=useState([]);
useEffect(()=>{
donatorslip()
},)

const getdetailslip=async()=>{
let response =await donatorslip();
console.log(response);
setUsers(response.data);
}

  return (


    <>
      <div  style={{ margin: "auto", width: "50%" }} className="mt-5 mb-5">
        <br></br><br></br>
        <br></br><br></br>
        <div align="center">
          <Card style={{ width: '29rem' }}>
            <Card.Header><h3>Donation Successfull</h3></Card.Header>
            <Card.Body>

              <h4>Thank you for donation</h4>
          


              <Button className="d-flex justify-content-center" onClick={() => { navigate("/"); }} variant="success">Next</Button>
            </Card.Body>
          </Card>
        </div>
      </div>

    </>

  );
}

export default Success;
